import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';
import FarmerPage from './components/FarmerPage';
import RegisterForm from './components/RegisterForm';
import LoginForm from './components/LoginForm';
import RegisterFarmerForm from './components/RegisterFarmerForm';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<HomePage />} />
        <Route path="/farmers/:id" element={<FarmerPage />} />
        <Route path="/login/:type" element={<LoginForm />} /> {/* Route paramétrée */}
        <Route path="/register" element={<RegisterForm />} />
        <Route path="/register/farmer" element={<RegisterFarmerForm />} /> {/* Nouvelle route */}
      </Routes>
    </Router>
  );
}

export default App;
